function addEvents(e){$(window).on("hashchange",function(){changeStatusByHash(e.footer,["newsletter"])})}function setFooterDate(e){var t=(new Date).getFullYear();e.footer.append(t)}function changeStatusByHash(e,t){var n=location.hash.substr(1,location.hash.length-1);t.includes(n)?e.addClass("active"):e.removeClass("active")}$(document).ready(function(){const e={nav:$("nav.navbar"),fullpage:$("#fullpage"),footer:$("footer")};changeStatusByHash(e.footer,["newsletter"]),setFooterDate(e),addEvents(e),e.fullpage.fullpage()});